"use strict";angular.module("TimebookApp",[]).controller("HomeController",["$scope","homeService","$compile",function(e,t,n){e.amount=null,setInterval(function(){e.$apply(function(){t.getAmount().success(function(t){e.amount=t})})},1e3)}]).service("homeService",["$http",function(e){this.getAmount=function(){return e.get("/amount")}}]);